import React from 'react';

const RestaurantManagementPage = () => {
  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-red-500 via-yellow-400 to-orange-600">
      <div className="max-w-2xl w-full bg-white p-8 rounded-lg shadow-lg text-center">
        {/* Background Image Overlay */}
        <div className="absolute inset-0 bg-gradient-to-r from-red-500 via-yellow-400 to-orange-600 opacity-70 rounded-lg"></div>
        <h2 className="text-3xl font-extrabold text-gray-800 mb-6 relative z-10">
          <span className="text-red-600">
            <i className="fas fa-utensils mr-2"></i>
          </span>
          Restaurant Management
        </h2>
        {/* Your restaurant management content goes here */}
        {/* Example: */}
        <p className="text-white text-lg mb-4">Welcome to the Restaurant Management Page</p>
        <button className="bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700 transition duration-300">
          Manage Menu
        </button>
        <button className="bg-yellow-400 text-white px-4 py-2 rounded hover:bg-yellow-500 transition duration-300">
          View Orders
        </button>
        {/* Add more content/buttons as needed */}
      </div>
    </div>
  );
};

export default RestaurantManagementPage;
